  return (
    <>
          <div className={styles.logo}>

          <div className={styles.borda1}>
            <h1>Toro's Coffee</h1>
          </div>

          <div className={styles.borda1}>
            <CoffeeIcon sx={{ fontSize: 30 }}  />
          </div>

          </div>

      <div className={styles.dp_flex}>
        <a className={styles.borda} href="/">

          Produtos

        </a>

        <a className={styles.borda} href="/">
          Sobre
        </a>
  
      </div>
    </>
  );
};

export default Header;
